import './Category_list.css'
function CategoryList() {
    const categories = [{id:1,name:"Fashion"},{id:2,name:"Accesories"}]
  return(
  <div class = "lista">
    <h3>CATEGORIES</h3>
    <ul class="kategorije">
    {categories.map(cat => (
      <li  key={cat.id}>{cat.name}</li>
    ))}
    </ul>
  </div>
  );
}

export default CategoryList;
